import { WhoKill } from "../images/css-3.png";

export default function ProjectsPage(){
  
    return (
        <div className='h-screen w-full bg-main flex justify-center items-center p-4'>
            <div className="flex flex-col">
                <span className="text-3xl color-main">PROJECTS</span>
                <ProjectBox text="WHO KILLED MARIAM" image={WhoKill}/>
            </div>
        </div>
      );
}
